(function() {
    'use strict';
    var body = document.querySelector('body');
    var goTop = document.createElement('div');
    var imgBox = document.createElement('img');
    goTop.style.position = 'fixed';
    goTop.style.right = '10%';
    goTop.style.bottom = '10%';
    goTop.style.fontSize = '30px';
    goTop.style.cursor = 'pointer';
    goTop.style.userSelect = 'none';
    imgBox.src = 'data:image/jpeg;base64,';
    imgBox.style.height = '60px';
    imgBox.style.width = '60px';
    goTop.appendChild(imgBox);
    body.appendChild(goTop);
    goTop.onclick = function () {
        var nowTop = document.body.scrollTop + document.documentElement.scrollTop;
        var scrollTimer = setInterval(function(){
            if(nowTop <= 0){
                clearInterval(scrollTimer);
            }else{
                nowTop -= 200;
                document.body.scrollTop = document.documentElement.scrollTop = nowTop;
            }
        }, 10);
    }
    // Your code here...
})();